description:
This week's episode sees us head out to the seven seas for the official World of Warships launch! We caught up with both Wargaming and the Aussie developers from BigWorld and chat about the new game.

Jonny Robot brushes up on his French (and his stealth) with a look at the latest in the Tom Clancy franchise from Ubisoft, the very exciting Rainbow Six Siege.

And we have our suspicions that Firaxis might be full of aliens, who are all busily working together to bring us some glorious turn-based tactics early next year in XCOM 2.

...plus, of course, we have all the latest gaming news as well - this is Player Attack!
